const express = require('express');
const app = express();
const cors = require('cors');
const bodyParser = require('body-parser');
const port = process.env.PORT ||5000;
const axios = require('axios');
const dotenv = require('dotenv'); // .env 파일에서 환경변수 불러오기
dotenv.config();

const ID_KEY = `${process.env.REACT_APP_API_NAVER_ID_KEY}`; //naver_SEARCH
const SECRET_KEY = `${process.env.REACT_APP_API_NAVER_SECRET_KEY}`;  //naver_SEARCH
const serviceKey = `${process.env.REACT_APP_API_KEY}`; // 공공데이터
const rest_api = `${process.env.REACT_APP_KAKAO_REST_API_KEY}`

app.use(cors());

app.use(bodyParser.json());

//1.naver_search_local
app.use('/searchlocal', (req, res) => {
  const word = req.query.query;
  axios.get('https://openapi.naver.com/v1/search/local.json', {
    params: {
      query: word,
      display: 5,
      start:1
    },
    headers: {
      'X-Naver-Client-Id': ID_KEY,
      'X-Naver-Client-Secret': SECRET_KEY,
      'Access-Control-Allow-Origin': '*'
    }
  }).then(function(response) {
    const items = response
    .data.items;
    res.send({items:items});
  }).catch(function(error) {
    console.log(error);
  });

});

//네이버 검색 이미지 api
app.use('/searchimg', (req, res) => {
    const word = req.query.query;
    axios.get('https://openapi.naver.com/v1/search/image.json', {
      params: {
        query: word,
        display: 1
      },
      headers: {
        'X-Naver-Client-Id': ID_KEY,
        'X-Naver-Client-Secret': SECRET_KEY,
        'Access-Control-Allow-Origin': '*'
      }
    }).then(function(response) {
      const items = response.data.items;
      res.send({items:items});
    }).catch(function(error) {
      console.log(error);
    });
  
  });
