app.get('/gongsearch', async (req, res) => {
  const airUrl = "http://map.vworld.kr/search.do?";

  let parmas= encodeURI('apiKey') + '='+ encodeURI(`DF5B534B-86A9-3E6E-8F44-AF6DBF866424`);
  parmas +='&' + encodeURI('category') + '='+ encodeURI('Poi');
  parmas +='&' + encodeURI('q') + '='+ encodeURI('강남');
  parmas +='&' + encodeURI('pageunit') + '='+ encodeURI(10);
  parmas +='&' + encodeURI('output') + '='+ encodeURI('json');
  parmas +='&' + encodeURI('pageindex') + '='+ encodeURI(1);


  const url = airUrl + parmas;

  try {
      const result = await axios.get(url,{headers: {
        'Access-Control-Allow-Origin': '*'
      }});
      res.json(result.data); 
  } catch (error) {
      console.log(error);
  }
});

